import PropTypes from "prop-types";

import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/swiper.scss";
const NavBar = (props) => {
  return (
    <div className="rev-slider">
      <div className="fullwidthbanner-container">
        <div className="fullwidthbanner">
          <div className="bannercontainer">
            <div className="banner">
              <ul>
                <Swiper
                  spaceBetween={50}
                  slidesPerView={1}
                  onSlideChange={() => console.log("slide change")}
                  onSwiper={(swiper) => console.log(swiper)}
                >
                  <SwiperSlide>
                    <img
                      src="assets/img/home/Untitled-2.png"
                      width="100%"
                      height="500"
                      alt="Chicago"
                    ></img>
                  </SwiperSlide>
                  <SwiperSlide>
                    {" "}
                    <img
                      src="assets/img/home//Untitled-1.png"
                      width="100%"
                      height="500"
                      alt="Chicago"
                    ></img>
                  </SwiperSlide>
                  <SwiperSlide>
                    {" "}
                    <img
                      src="assets/img/home//Untitled-1.png"
                      width="100%"
                      height="500"
                      alt="Chicago"
                    ></img>
                  </SwiperSlide>
                  <SwiperSlide>
                    {" "}
                    <img
                      src="assets/img/home//Untitled-2.png"
                      width="100%"
                      height="500"
                      alt="Chicago"
                    ></img>
                  </SwiperSlide>
                </Swiper>
              </ul>
            </div>
          </div>
          <div className="tp-bannertimer" />
        </div>
      </div>
    </div>
  );
};

NavBar.propTypes = {};

export default NavBar;
